import React, { Component } from 'react'
import './home.css'
import  Logo from '../imgs/Green_Logo.png';

export default class Home extends Component {
    constructor(props){
        super(props)
        this.state = {
            display: true, 
            autoplay: false,
        }
    }
    

render(){
    return(
        <div className='header'>
            <img src={Logo} alt='header' style={{width:'7%', height:'100%'}}/>
            <span>WORK</span>
            
            <div id="PLAY">
                <span>PLAY</span>
            </div>
        </div>
    )
}

}

const Green_logo = {
    
    position: 'relative', 
    overflow: 'hidden',
}
